// ==UserScript==
// @name         PS5 alerts
// @namespace    http://manuelseeger.de
// @version      0.1
// @description  Alert me once the PS5 is available
// @author       Manuel Seeger
// @match        https://www.amazon.de/hz/wishlist/*
// @icon         https://www.google.com/s2/favicons?domain=amazon.de
// @grant        none
// @require      https://gist.githubusercontent.com/BrockA/2625891/raw/9c97aa67ff9c5d56be34a55ad6c18a314e5eb548/waitForKeyElements.js
// @require      https://code.jquery.com/jquery-3.6.0.min.js
// ==/UserScript==

(async function() {
    'use strict';

    $('#g-items').trigger('click');

    let a;
    const audio = document.createElement('audio');
    audio.src = 'data:audio/mpeg;base64,';
    audio.volume = 0.3;

    document.body.appendChild(audio);

    // digital edition
    if ($('#g-items li:eq(0) span[data-action="add-to-cart"]').length) {
        a = $('#g-items li:eq(0) span[data-action="add-to-cart"] a')[0];
        audio.play();
        await new Promise(r => setTimeout(r, 2500));
        document.location.href = a.href;
    }
    // drive edition
    if ($('#g-items li:eq(1) span[data-action="add-to-cart"]').length) {
        a = $('#g-items li:eq(1) span[data-action="add-to-cart"] a')[0];
        audio.play();
        await new Promise(r => setTimeout(r, 2500));
        document.location.href = a.href;
    }
    setTimeout(function() { window.location.reload(1); }, 15000);
})();